import React from 'react';
import { Button, Form, FormGroup, Input, Container } from 'reactstrap';

import './login.css';
const LoginPage = (props) => {
  return (
      <Container>
        <h1>Login</h1>
        <Form action="" method="POST" >
            <FormGroup >
                <Input type="username" name="username" id="username" placeholder="username" size="350" />
            </FormGroup>
            <FormGroup>
                <Input type="password" name="password" id="password" placeholder="password" width="350px" />
            </FormGroup>
            <Button>Login</Button>
        </Form>
      </Container>
  );
}

export default LoginPage;
